INSERT INTO "status" VALUES(406,1,'2016-01-09 12:39:00','最近读了东野圭吾的这本《解忧杂货店》。虽然有人批评鸡汤味太浓，但是我自己很喜欢。喜欢最后浪矢老爷爷对空白信的回复，喜欢不同的人生轨迹相互缠绕和温暖。如果“浪矢杂货店”真的存在就好了，但现在存在的话一天之内应该回不完那么多信吧哈哈~。读完了，心里酸酸的又暖暖的<img alt="[心]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/40/hearta_org.gif"/>',NULL,'005Hl0D7gw1ezt3twrr95j31kw11xdr7.jpg',0,NULL,NULL,NULL,'');
