INSERT INTO "status" VALUES(658,1,'2015-06-04 11:06:00','#SNH48登男人装封面#<img alt="[good]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d8/good_org.gif"/><img alt="[good]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d8/good_org.gif"/>好看！<img alt="[心]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/40/hearta_org.gif"/>',NULL,'',1,NULL,'<span class="name">SNH48</span>：#SNH48登男人装封面# 国内顶级时尚杂志<span class="name">@男人装</span> 携手SNH48赴塞班拍摄的封面大片于今日公布，《男人装》6月刊现已在全国各大书报亭上架销售。该组照片系#SNH48第2届总选举#投票MV《盛夏好声音》筹备期间拍摄。感谢《男人装》首席摄影师<span class="name">@神思远</span> 倾力呈现，请收下官博君的膝盖：<a data-canonical-href="http://t.cn/R2SYIKe" href="http://www.tudou.com/programs/view/fHFTfn_iLbw/" target="_blank">tudou.com/program...</a>',NULL,'a04b2a1dgw1esrtdcppbvj20p00whdux.jpg a04b2a1dgw1esrtdkgmj6j20p00weand.jpg a04b2a1dgw1esrtdg3iocj20xc0m8q8h.jpg a04b2a1dgw1esrtdj0sl9j20p00wh7mx.jpg a04b2a1dgw1esrtdgxfbpj20p00godky.jpg a04b2a1dgw1esrtdjsm0gj20xc0m8tgm.jpg a04b2a1dgw1esrtddsmiaj20p00whgxs.jpg a04b2a1dgw1esrtdljl0kj20xc0m8gun.jpg a04b2a1dgw1esrtdez8mwj20p00whn80.jpg');
