INSERT INTO "status" VALUES(844,1,'2015-01-01 10:58:00','<img alt="[泪]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/9d/sada_org.gif"/>一大早醒来看到这样的消息… 好心痛…在迎新的倒数声中逝去的35个灵魂，愿安息。<img alt="[蜡烛]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d9/lazhuv2_org.gif"/><img alt="[蜡烛]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d9/lazhuv2_org.gif"/><img alt="[蜡烛]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d9/lazhuv2_org.gif"/>愿2015年 身边的大家都能平平安安 一切安好',NULL,'',1,NULL,'<span class="name">人民日报</span>：#上海外滩跨年夜踩踏#【新年惨剧！上海外滩跨年夜发生踩踏事故 已致35死43伤】2014年12月31日晚23点35分许，上海黄浦区外滩陈毅广场发生群众拥挤踩踏事故，截至今晨5时已造成35人死亡，43人受伤。伤者多数是学生，已被紧急送至医院救治。事故原因调查中。<span class="name">@上海发布</span> 为那些未能走进新年的生命默哀<img alt="[蜡烛]" src="http://img.t.sinajs.cn/t4/appstyle/expression/ext/normal/d9/lazhuv2_org.gif"/>',NULL,'a716fd45jw1entnky4t50j20c80fdaay.jpg a716fd45jw1entnky0o0fj20c80fe75e.jpg a716fd45jw1entnky03i7j20c808at9m.jpg a716fd45jw1entnkxm7wdj20c8085755.jpg a716fd45jw1entnkxqxp1j20c809674u.jpg a716fd45jw1entnkxtx6nj20c80gb3zx.jpg a716fd45jw1entnkxzfhzj20c8096dhc.jpg a716fd45jw1entnkxmb6cj20c806wweh.jpg a716fd45jw1entnkxsw36j20c8096mxt.jpg');
