INSERT INTO "comment" VALUES(2010,402,1,'2016-01-11 18:00:00','《嫌疑犯X的献身》电影版有看过~《十二怒汉》看的是97年版的，中国版的《十二公民》也看了，不过有人觉得最后结尾太话剧了，我倒是很喜欢。只是中间内容紧凑却层次不够分明，“表演”也有点过，更像看舞台剧。《飞越老人院》是一部我很喜欢的作品，看了蛮多遍的 大家有空也可以看看哦~',NULL);
