INSERT INTO "comment" VALUES(5593,208,1,'2016-07-13 06:33:00','不是所有的导演都是来拍戏的2333 问这个问题的时候我想了很多，我会钢琴算优势吗？但是团里会钢琴比我专业的人有很多…那…我比较努力可以吗？谁又不努力呢？我说我可能是比较阳光乐观！可是这又算什么优势… 看起来像发玩笑一般的微博其实自己也想了很多，是的… 我是时候要去练喷火了',NULL);
INSERT INTO "comment" VALUES(5594,208,1,'2016-07-13 07:15:00','虽然把自己会的都展示了，但是真的被问住了。也开始思考到底我为什么走到现在。我的确是一个在某些方面没有什么斗志的人，因为我始终相信是你的就是你的，我就做好我自己，不是你的即使机会到了也得不到，就像国美一样，面试的时候导演特别满意，结果却受伤了而不能参加录制',NULL);
INSERT INTO "comment" VALUES(5595,208,1,'2016-07-13 07:25:00','我感慨这些机遇的时候也感慨自己终究适不适合这里，面试的时候导演问我有没有参加过什么大型综艺或者电视剧，我答不出来。问我去年总选举你是第几名，我说是圈外。然后又笑着跟导演说那是去年嘛第一次参加，作为后辈不能太高调的！脸上笑着，心里却一种说不出来的滋味。',NULL);
INSERT INTO "comment" VALUES(5596,208,1,'2016-07-13 07:46:00','总是会在一些状况下怀疑自己，时间告诉我我也要做出选择，一年复一年，一年何其多。临近总选，情绪也变得不那么稳定，昨晚看到大家都在那么拼的为我集资，真的特别开心。下次我可以跟那个导演说我今年的总选举进了吗。',NULL);
